import React, { Component } from 'react';
import './App.css';
import Main from './components/main';
import Home from './components/home';
import location from './location1.png'
import linkedin from './linkedin1.png'
import git from './git1.png'
import logo from './projectpictures/_Logo.png'
import
{
Collapse,
Navbar,
NavbarToggler,
NavbarBrand,
Nav,
NavItem,
NavLink,
Container
} from 'reactstrap';
import { userInfo } from 'os';





class App extends Component {

  state = {
    isOpen: false 
}

toggle = () =>
{
    this.setState(
        {
            isOpen: !this.state.isOpen
        });
}

  render() {
    return (

      <div className="App">
 <Navbar id="navbar" font="" height="px;"  expand="sm" className="mb-0">
                <Container>
                    <NavbarBrand href="/">

       <span id="logoimage"></span>

                    </NavbarBrand>
                    <NavbarToggler onClick = {this.toggle} ></NavbarToggler>
                    <Collapse isOpen={this.state.isOpen} navbar>
                    <Nav className="ml-auto" height="0px">
                    <NavItem>
                        <NavLink href="home">
                           Home
                        </NavLink>
                    </NavItem>
                    <NavItem>
                        <NavLink height="50px;" href="contact">
                        CRUD
                        </NavLink>

                    </NavItem>
                    <NavItem>
                        <NavLink href="about">
                       About 
                        </NavLink>

                    </NavItem>
                    </Nav>
                    </Collapse>
                </Container>
            </Navbar>


<Main/>
      </div>
    );
  }
}

export default App;
